import React from 'react';
import { Link } from 'react-router-dom';


const Navbar = () => {
    return (
        <nav className="navbar">
            <div className="logo">
                <img src="/assets/logo.png" alt="Logo" />
            </div>
            <div className="links">
                <Link to="/">Home</Link>
                <Link to="/cart">Cart</Link>
            </div>
        </nav>
    );
};

export default Navbar;
